def cost(dir=True): #dir is not east
  if dir:
    return 3   #3 is step cost
  else:
    return 3 + 5  #5 is penalty for taking east direction

def manhattanDistance(x,y):
  return abs(x[0]-y[0])+abs(x[1]-y[1])

def set_values(values):
  values = [[[-1,-1] for _ in range(7)]for x in range(6)]
  values[InitialStep[0]][InitialStep[1]] = [0,-1]
  values[TargetStep[0]][TargetStep[1]] = [-1,0]
  for x in range(len(values)):
    for y in range(len(values[x])):
      values[x][y][1]= manhattanDistance([x,y],TargetStep)
  return values

values=set_values(values)

pd.DataFrame(values)

class A_star_Algorithm:
  count = 0
  def __init__(self,w,values,maze,InitialStep,TargetStep):
    self.w=w
    self.values=values
    self.maze=maze
    self.Initial=InitialStep
    self.Target = TargetStep
    self.present = InitialStep
    self.heap = []
    self.tracking=[]

  def run_A_star(self):
    if self.present == self.Target:
      print("Target Reached.Goal test passes.")
      return self.values[self.Target[0]][self.Target[1]]    #g(n) is returned
    print("Goal Test on " , self.present ,"  fails ")
    k = self.maze[self.present[0]][self.present[1]]
    self.select_step(k)
    self.run_A_star()


  def cal_f_of_n(self,k,r,dir=True):
    # print("errror",r, k+cost(dir) + self.w*self.values[r[0]][r[1]][1])
    if self.values[r[0]][r[1]][0]==-1 and r[0]>=0 and r[1]>=-1:
      return k+cost(dir) + self.w*self.values[r[0]][r[1]][1],cost(dir)
    else:
      return 10000,686   #not to run in infinite loop

  def select_step(self,k):
    # print(k)
    m = 10000
    r = 0
    val = self.values[self.present[0]][self.present[1]][0]
    if k[0]=="0":                #north
      t,r = self.cal_f_of_n(val,[self.present[0]-1,self.present[1]])
      self.sorted_heap([t,val+r,[self.present[0]-1,self.present[1]]])
    if k[1]=="0":            #south
      t,r = self.cal_f_of_n(val,[self.present[0]+1,self.present[1]])
      self.sorted_heap([t,val+r,[self.present[0]+1,self.present[1]]])
    if k[2]=="0":          #east
      t,r = self.cal_f_of_n(val,[self.present[0],self.present[1]+1],False)    #it is east hence direction is not east = false
      self.sorted_heap([t,val+r,[self.present[0],self.present[1]+1]])
    if k[3]=="0":              #west
      t,r = self.cal_f_of_n(val,[self.present[0],self.present[1]-1])
      self.sorted_heap([t,val+r,[self.present[0],self.present[1]-1]])
    # self.present = step
    # print(self.present)
    # self.values[self.present[0]][self.present[1]][0] = val+r_final
    temp = self.heap.pop(0)          # minimum value is being popped out
    # print(self.heap,temp)

    self.present = temp[2]                # initializing path to start from popped out value
    self.values[self.present[0]][self.present[1]][0] = temp[1]
    self.tracking.append([temp,A_star_Algorithm.count])
    A_star_Algorithm.count+=1

  def sorted_heap(self,k):
      if k[0]==10000:
        return
      self.heap.append(k)
      self.heap.sort(key=lambda x: x[0])

